import React, { Component } from 'react';
import { Link, Navigate } from 'react-router-dom';

class Data extends Component{
    
    handleClick() {
        return <Navigate to="/" />
    }
    
    render() {
        return (
            <div>
                This is Data
                <Link></Link>
            </div>
        )
    }
}
export default Data
